    MES3   DB  'To exit the program press Esc','$'
    MES4   DB  'To play again press f2','$'
    Mes5   DB  'Please Enter Your Name','$'
    Mes6   DB  'Press Enter to Continue','$'
    Mes7   DB  'Invalid name Try Again','$'
