    SCREEN_HEIGHT               DW  9eh ;200 PIXELS
    WINDOW_BOUNDS               DW  6                       ;variable used to check collisions early
    
    ;ball varibles
    BALL_X_ORIGIN               DW  0a0h                   ;(160,100)
    BALL_Y_ORIGIN               DW  3fh
    BALL_X                      DW  0a0h                   ; x postion of the ball
    BALL_Y                      DW  3fh                    ; y postion of the ball
    BALL_SPEED_X                DW  6 ; speed x
    BALL_SPEED_Y                DW  6 ; speed y
    Original_BALL_SPEED_X       DW  6 ; speed x
    Original_BALL_SPEED_Y       DW  6 ; speed y
    BALL_SIZE                   EQU 6
    BALL_COLOR                  DB  1                      ;the intial color of the ball  ;4*4=16 PIXELS
    
    ;paddle varibles
    PADDLE_LEFT_X               DW  1h                      ;paddle left postion x
    PADDLE_LEFT_Y               DW  30h                     ;paddle left postion y
