    ;powers varibles
    IS_POWER_FIRE_DRAW_U       DB  0h;varible determined if there are a fire power in USER Playground to draw it if 1 draw it if 0 don't draw, it will be (1) after M seconds
    IS_POWER_FIRE_HAVE_U       DB  0h;varible determined if USER have a fire power(one if the USER(Right) pick the fire power) will make the ball ?? ?????
    IS_POWER_FIRE_HAVE_U_RIGHT DB  0h;if the USER pick the fire power then we draw his paddel with red it will make him a red paddle
    IS_POWER_FIRE_DRAW_S       DB  0h;varible determined if there are a fire power in system Playground to draw it if 1 draw it if 0 don't draw, it will be (1) after M seconds
    IS_POWER_FIRE_HAVE_S       DB  0h;varible determined if SYSTEM have a fire power(one if the system(left) pick the fire power) will make the ball ?? ?????
