    POWER_FIRE_Y_LEFT_ORIGIN    DW  64h                      ;center for intial
    POWER_FIRE_X_RIGHT_ORIGIN   DW  0a0h                     ;(160,100)
    POWER_FIRE_Y_RIGHT_ORIGIN   DW  64h                      ;center for intial

