MOVE_PADDLE_PROC PROC near

   ;       Left paddle movement
        
; check if any key is being pressed (if not check the other paddle)
        MOV AH,01h
        INT 16h
        JZ CHECK_RIGHT_PADDLE_MOVEMENT ;ZF = 1, JZ -> Jump If Zero
        
; check which key is being pressed (AL = ASCII character)
        MOV AH,00h
        INT 16h
        
   
        ;if it is 'w' or 'W' move up
        CMP AL,77h ;'w'
        JE MOVE_LEFT_PADDLE_UP
        CMP AL,57h ;'W'
        JE MOVE_LEFT_PADDLE_UP
        
        ;if it is 's' or 'S' move down
        CMP AL,73h ;'s'
        JE MOVE_LEFT_PADDLE_DOWN
        CMP AL,53h ;'S'
        JE MOVE_LEFT_PADDLE_DOWN
        JMP CHECK_RIGHT_PADDLE_MOVEMENT
        
        MOVE_LEFT_PADDLE_UP:
            MOV AX,L_PADDLE_SPEED
            SUB PADDLE_LEFT_Y,AX
            
            MOV AX,WINDOW_BOUNDS
            CMP PADDLE_LEFT_Y,AX
            JL FIX_PADDLE_LEFT_TOP_POSITION
            JMP CHECK_RIGHT_PADDLE_MOVEMENT
            
            FIX_PADDLE_LEFT_TOP_POSITION:
                MOV PADDLE_LEFT_Y,AX
                JMP CHECK_RIGHT_PADDLE_MOVEMENT
            
        MOVE_LEFT_PADDLE_DOWN:
            MOV AX,L_PADDLE_SPEED
            ADD PADDLE_LEFT_Y,AX
            MOV AX,SCREEN_HEIGHT
            SUB AX,WINDOW_BOUNDS
            SUB AX,PADDLE_LEFT_HEIGHT
            CMP PADDLE_LEFT_Y,AX
            JG FIX_PADDLE_LEFT_BOTTOM_POSITION
            JMP CHECK_RIGHT_PADDLE_MOVEMENT
            
            FIX_PADDLE_LEFT_BOTTOM_POSITION:
                MOV PADDLE_LEFT_Y,AX
                JMP CHECK_RIGHT_PADDLE_MOVEMENT
        
        
;       Right paddle movement
        CHECK_RIGHT_PADDLE_MOVEMENT:
        
         CMP AI_CONTROLED ,01H
         JE CONTROL_BY_AI 

;        The paddle is controled by AI  
          CONTROL_BY_AI :
; Check if the ball is at the top the paddle
            MOV AX,BALL_Y
            Sub AX,4h
            ADD AX,BALL_SIZE
            CMP AX,PADDLE_RIGHT_Y
            JL MOVE_RIGHT_PADDLE_UP
            
            
; Check if the ball is at the bottom the paddle
             MOV AX,PADDLE_RIGHT_Y
             Sub AX,4h
             ADD AX,PADDLE_RIGHT_HEIGHT
             CMP AX,BALL_Y
             JL MOVE_RIGHT_PADDLE_DOWN
            
            
; if none of this exit
            JMP EXIT_PADDLE_MOVEMENT
            

            MOVE_RIGHT_PADDLE_UP:
                MOV AX,R_PADDLE_SPEED
                SUB PADDLE_RIGHT_Y,AX
                
                MOV AX,WINDOW_BOUNDS
                CMP PADDLE_RIGHT_Y,AX
                JL FIX_PADDLE_RIGHT_TOP_POSITION
                JMP EXIT_PADDLE_MOVEMENT
                
                FIX_PADDLE_RIGHT_TOP_POSITION:
                    MOV PADDLE_RIGHT_Y,AX
                    JMP EXIT_PADDLE_MOVEMENT
            
            MOVE_RIGHT_PADDLE_DOWN:
                MOV AX,R_PADDLE_SPEED
                ADD PADDLE_RIGHT_Y,AX
                MOV AX,SCREEN_HEIGHT
                SUB AX,WINDOW_BOUNDS
                SUB AX,PADDLE_RIGHT_HEIGHT
                CMP PADDLE_RIGHT_Y,AX
                JG FIX_PADDLE_RIGHT_BOTTOM_POSITION
                JMP EXIT_PADDLE_MOVEMENT
                
                FIX_PADDLE_RIGHT_BOTTOM_POSITION:
                    MOV PADDLE_RIGHT_Y,AX
                    JMP EXIT_PADDLE_MOVEMENT
        
        EXIT_PADDLE_MOVEMENT:
        
            RET
        
MOVE_PADDLE_PROC ENDP


DRAW_SCORE PROC NEAR
                   
                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,0           ;X-position of the message(x)
                   MOV   DH,20          ;move the cursor to the new line(y)
                   INT   10H
                                 
    ; draw an line1
                   mov   cx,0           
                   mov   dx,SCREEN_HEIGHT                       
                   mov   al,1           ;Pixel color
                   mov   ah,0ch         ;Draw Pixel Command
    back1:         int   10h
                   inc   cx
                   cmp   cx,320
                   jnz   back1
                                  
                   MOV   AH,09H
                   MOV   DX,offset USER+2  
                   INT   21H

                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,USER+1      ;X-position of the message(x)
                   add   DL,1
                   MOV   DH,20          ;move the cursor to the new line(y)
                   INT   10H

                   MOV   AH,09H
                   MOV   DX,offset score   
                   INT   21H
           

                   mov   dl,LEFT_SCORE_GAMES
                   add   dl,30h         
                   mov   ah,2
                   int   21h
                                  
                                  
                                
                   mov   dl," "
                   mov   ah,2
                   int   21h

                   mov   dl,LEFT_SCORE_DER_GAME
                   add   dl,30h         
                   mov   ah,2
                   int   21h
                                  
                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,22          ;X-position of the message
                   MOV   DH,20          ;move the cursor to the new line
                   INT   10H

                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,0           ;X-position of the message(x)
                   MOV   DH,21          ;move the cursor to the new line(y)
                   INT   10H

                   MOV   AH,09H
                   MOV   DX,offset SYSTEM+2                
                   INT   21H

                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,SYSTEM+1    ;X-position of the message(x)
                   SUB   DL,26
                   MOV   DH,21          ;move the cursor to the new line(y)
                   INT   10H

                   MOV   AH,09H
                   MOV   DX,offset score                        
                   INT   21H
           

                   mov   dl,RIGHT_SCORE_GAMES
                   add   dl,30h         
                   mov   ah,2
                   int   21h

                                
                   mov   dl," "
                   mov   ah,2
                   int   21h

                   mov   dl,RIGHT_SCORE_DER_GAME
                   add   dl,30h         
                   mov   ah,2
                   int   21h
; draw line2
                   mov   cx,0           
                   mov   dx,SCREEN_HEIGHT                       
                   add   dx,20
                   mov   al,1           ;Pixel color
                   mov   ah,0ch         ;Draw Pixel Command
    back2:         int   10h
                   inc   cx
                   cmp   cx,320
                   jnz   back2
             
                   ret
DRAW_SCORE ENDP


DRAW_CENTER PROC near
                   mov   cx,0a0h        ;Column
                   mov   bx,0           ; rows
    increase_WITH_NO_DRAW:              
                   inc   bx
    draw_center_oa:
                   mov   ax,bx
                   mov   cx,20
                   mov   dx,0
                   DIV   cx             ;ax/20 = ax=ax/20 dx=ax%20
                   cmp   dx,0           ;if(dx%20==0) then inc with no draw
                   je    increase_WITH_NO_DRAW
                   mov   dx,bx
                   mov   cx,0a0h
                   mov   ah,0ch         ;Draw Pixel Command
                   mov   al,1           ;Pixel color
                   mov   bh,0           ; page number
                   int   10h            ; draw an pixel
                   inc   bx
                   cmp   bx,SCREEN_HEIGHT
                   jg    END_DRAW_CENTER
                   jmp   draw_center_oa
    END_DRAW_CENTER:                    
                   ret
DRAW_CENTER ENDP


Respawn_PowerUp_FREEZE PROC near
                   pusha

                   mov   dh,01h
                   mov   cl,dl
                   mov   Respawn_Time,dx                       ;Here we reset Respawn_Time with a random value
                   cmp   IS_POWER_FREEZE_DRAW_S,1              ;if power-up for SYSTEM we keep gaming and generate no more power up
                   je    DontRespawnFREEZE
                   cmp   IS_POWER_FREEZE_DRAW_U,1              ;if power-up for USER we keep gaming and generate no more power up
                   je    DontRespawnFREEZE
                   mov   al,1h                                 ;unless we reset them to 1 for drawing a new power-up
                   mov   IS_POWER_FREEZE_DRAW_U,al
                   mov   IS_POWER_FREEZE_DRAW_S,al

;  in this section we reset the power-up position
                   mov   ax,POWER_FREEZE_X_RIGHT_ORIGIN
                   mov   POWER_FREEZE_X_RIGHT,ax
                   mov   ax,POWER_FREEZE_X_LEFT_ORIGIN
                   mov   POWER_FREEZE_X_Left,ax
                   mov   ax,cx
                   mov   cl,2
                   mul   cl
                   cmp   al,9eh
                   jl    SetCenterFREEZE
                   mov   ah,0
                   mov   POWER_FREEZE_Y_RIGHT,ax
                   mov   POWER_FREEZE_Y_LEFT,ax
                   jmp   DontRespawnFREEZE

    SetCenterFREEZE:                    
                   mov   ax ,POWER_FREEZE_Y_RIGHT_ORIGIN
                   mov   POWER_FREEZE_Y_RIGHT,ax
                   mov   ax,POWER_FREEZE_Y_LEFT_ORIGIN
                   mov   POWER_FREEZE_Y_LEFT,ax
    DontRespawnFREEZE:                  
                   popa
                   ret
Respawn_PowerUp_FREEZE ENDP


