COUNTFREEZE_U proc near
                   cmp   ISFROZEN_U,0          
                   ;we check if USER is frozen, if 0=> we exit
                   je    RETURNFREEZE_U
                   cmp   FREEZETime_U,0                         ;we check if the freeze time is spent, if !0=> we decrease the time if 0=> we restore the paddle speed and color
                   jne   FINISHFREEZE_U

                   mov   ax,ORIGINAL_R_PADDLE_SPEED
                   mov   R_PADDLE_SPEED,ax
                   mov   al,0
                   mov   ISFROZEN_U,al
                   mov   al,1
                   mov   PADDLE_RIGHT_COLOR,al
                   ret

    FINISHFREEZE_U:
                   dec   FREEZETime_U
                   ret

    RETURNFREEZE_U:
                   ret
COUNTFREEZE_U ENDP


