DRAW_FIRE_POWER_RIGHT_PROC PROC near

    
                   cmp   IS_POWER_FIRE_DRAW_U,1
                   jne   EXIT_WITH_NO_DRAW_FIRE
                   mov   cx,POWER_FIRE_X_RIGHT
                   mov   dx,POWER_FIRE_Y_RIGHT
    draw_fire:     
                   mov   ah,0ch         ;Draw Pixel Command
                   mov   al,4           ;Pixel color
                   mov   bh,0           ; page number
                   int   10h            ; draw an pixel
                   inc   cx             
                   mov   ax,cx
                   sub   ax,POWER_FIRE_X_RIGHT
                   cmp   ax,POWER_FIRE_SIZE
                   jne   draw_fire                              ;if(cx-xpos==size) then go endl else go new col
                   mov   cx,POWER_FIRE_X_RIGHT
                   inc   dx
                   mov   ax,dx
                   sub   ax,POWER_FIRE_Y_RIGHT
                   cmp   ax,POWER_FIRE_SIZE                     ;if(finsh all rows then ret else go up with new row)
                   jne   draw_fire

    EXIT_WITH_NO_DRAW_FIRE:             
                   ret
DRAW_FIRE_POWER_RIGHT_PROC ENDP


choose_level proc near

                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,6           ;X-position of the message
                   MOV   DH,8           ;Y-position of the message
                   INT   10H
           
                   MOV   AH,02H
                   MOV   DL,'*'         ;print the first *
                   INT   21H
           
                   MOV   AH,09H
                   MOV   DX,offset MES8 ;print the first line
                   INT   21H
           
                   MOV   AH,02H         ;move cursor to X,Y position
                   MOV   DL,6           ;X-position of the message
                   MOV   DH,11          ;move the cursor to the new line
                   INT   10H
           
                   MOV   AH,02H
                   MOV   DL,'*'         ;print the second *
                   INT   21H
           
                   MOV   AH,09H         ;print the second line
                   MOV   DX,offset MES9
                   INT   21H

                   ret
choose_level ENDP


beep proc                                ;when clear screen happens
        push ax
        push bx
        push cx
        push dx
        mov     al, 182                  ; Prepare the speaker for the note.
        out     43h, al                 
        mov     ax, 1000                 ; Frequency number (in decimal)for middle C.
                                        
        out     42h, al                  ; Output low byte.
        mov     al, ah                   ; Output high byte.
        out     42h, al 
        in      al, 61h                  ; Turn on note (get value from  port 61h)
                                
        or      al, 00000011b            ; Set bits 1 and 0.
        out     61h, al                  ; Send new value.
        mov     bx, 2                    ; Pause for duration of note.
.pause1:
        mov     cx, 65535
.pause2:
        dec     cx
        jne     .pause2
        dec     bx
        jne     .pause1
        in      al, 61h                  ; Turn off note (get value from  port 61h)
                                
        and     al, 11111100b            ; Reset bits 1 and 0.
        out     61h, al                  ; Send new value.

        pop dx
        pop cx
        pop bx
        pop ax

ret
beep endp


